import React from 'react';
import './App.css';
import MenuBar from './MenuBar';

const TypewriterText = () => {
  const textRef = useRef(null);

  useEffect(() => {
    textRef.current.classList.add("typewriter-text");
    return () => {
      textRef.current.classList.remove("typewriter-text");
    };
  }, []);

  return <h1 ref={textRef}>Typewriter text</h1>;
};

function App() {
  return (
    <div className="App">
      <header>
        <MenuBar/>
        <TypewriterText/>
      </header>
